<?phpnamespace Nemundo\App\WebService\ClassDesigner;use Nemundo\App\ClassDesigner\Builder\AbstractClassBuilderForm;class ServiceRequestClassBuilderForm extends AbstractClassBuilderForm{    protected function loadContainer()    {        parent::loadContainer();        $this->formTitle = 'Service';    }    protected function onSubmit()    {        $builder = new ServiceRequestClassBuilder();        $builder->project = $this->project;        $builder->className = $this->className->getValue();        $builder->namespace = $this->app->namespace;        $builder->buildClass();    }}